	"socreation_test/SO_Create/view/DetailObjectNotFound.view.xml":'<mvc:View\n\tcontrollerName="socreation_test.SO_Create.controller.DetailObjectNotFound"\n\txmlns="sap.m"\n\txmlns:mvc="sap.ui.core.mvc"><MessagePage\n\t\tid="page"\n\t\ttitle="{i18n>detailTitle}"\n\t\ttext="{i18n>noObjectFoundText}"\n\t\ticon="sap-icon://product"\n\t\tdescription=""\n\t\tshowNavButton="{=\n\t\t\t${device>/system/phone} ||\n\t\t\t${device>/system/tablet} &amp;&amp;\n\t\t\t${device>/orientation/portrait}\n\t\t}"\n\t\tnavButtonPress=".onNavBack"></MessagePage></mvc:View>',
	"socreation_test/SO_Create/view/Master.view.xml":'<mvc:View controllerName="socreation_test.SO_Create.controller.Master" xmlns="sap.m" xmlns:semantic="sap.f.semantic"\n\txmlns:mvc="sap.ui.core.mvc"><semantic:SemanticPage id="masterPage" preserveHeaderStateOnScroll="true" toggleHeaderOnTitleClick="false"><semantic:titleHeading><Title id="masterPageTitle" text="{masterView>/title}" level="H2"/></semantic:titleHeading><semantic:content><List id="list" width="auto" class="sapFDynamicPageAlignContent"\n\t\t\t\titems="{ path: \'/ProductSet\', sorter: { path: \'ProductID\', descending: false }, groupHeaderFactory: \'.createGroupHeader\' }"\n\t\t\t\tbusyIndicatorDelay="{masterView>/delay}" noDataText="{masterView>/noDataText}"\n\t\t\t\tmode="{= ${device>/system/phone} ? \'None\' : \'SingleSelectMaster\'}" growing="true" growingScrollToLoad="true"\n\t\t\t\tupdateFinished=".onUpdateFinished" selectionChange=".onSelectionChange"><infoToolbar><Toolbar active="true" id="filterBar" visible="{masterView>/isFilterBarVisible}" press=".onOpenViewSettings"><Title id="filterBarLabel" text="{masterView>/filterBarLabel}" level="H3"/></Toolbar></infoToolbar><headerToolbar><OverflowToolbar><SearchField id="searchField" showRefreshButton="true" tooltip="{i18n>masterSearchTooltip}" search=".onSearch" width="auto"><layoutData><OverflowToolbarLayoutData minWidth="150px" maxWidth="240px" shrinkable="true" priority="NeverOverflow"/></layoutData></SearchField><ToolbarSpacer/><Button id="sortButton" press=".onOpenViewSettings" icon="sap-icon://sort" type="Transparent"/><Button id="filterButton" press=".onOpenViewSettings" icon="sap-icon://filter" type="Transparent"/><Button id="groupButton" press=".onOpenViewSettings" icon="sap-icon://group-2" type="Transparent"/></OverflowToolbar></headerToolbar><items><ObjectListItem type="Navigation" press=".onSelectionChange" title="{Name}"\n\t\t\t\t\t\tnumber="{ path: \'Price\', formatter: \'.formatter.currencyValue\' }" numberUnit="{CurrencyCode}"></ObjectListItem></items></List></semantic:content></semantic:SemanticPage></mvc:View>',
	"socreation_test/SO_Create/view/NotFound.view.xml":'<mvc:View\n\tcontrollerName="socreation_test.SO_Create.controller.NotFound"\n\txmlns="sap.m"\n\txmlns:mvc="sap.ui.core.mvc"><MessagePage\n\t\tid="page"\n\t\ttitle="{i18n>notFoundTitle}"\n\t\ttext="{i18n>notFoundText}"\n\t\ticon="sap-icon://document"\n\t\tshowNavButton="true"\n\t\tnavButtonPress=".onNavBack"></MessagePage></mvc:View>',
	"socreation_test/SO_Create/view/ViewSettingsDialog.fragment.xml":'<core:FragmentDefinition\n\txmlns="sap.m"\n\txmlns:core="sap.ui.core"><ViewSettingsDialog\n\t\tid="viewSettingsDialog"\n\t\tconfirm=".onConfirmViewSettingsDialog"><sortItems><ViewSettingsItem\n\t\t\t\ttext="{i18n>masterSort1}"\n\t\t\t\tkey="Name"\n\t\t\t\tselected="true"/><ViewSettingsItem\n\t\t\t\ttext="{i18n>masterSort2}"\n\t\t\t\tkey="Price"/></sortItems><filterItems><ViewSettingsFilterItem\n\t\t\t\tid="filterItems"\n\t\t\t\ttext="{i18n>masterFilterName}"\n\t\t\t\tmultiSelect="false"><items><ViewSettingsItem\n\t\t\t\t\t\tid="viewFilter1"\n\t\t\t\t\t\ttext="{i18n>masterFilter1}"\n\t\t\t\t\t\tkey="Filter1"/><ViewSettingsItem\n\t\t\t\t\t\tid="viewFilter2"\n\t\t\t\t\t\ttext="{i18n>masterFilter2}"\n\t\t\t\t\t\tkey="Filter2"/></items></ViewSettingsFilterItem></filterItems><groupItems><ViewSettingsItem\n\t\t\t\ttext="{i18n>masterGroup1}"\n\t\t\t\tkey="Price"/></groupItems></ViewSettingsDialog></core:FragmentDefinition>',
	"socreation_test/SO_Create/view/fragments/displaycart.fragment.xml":'<core:FragmentDefinition xmlns="sap.m" xmlns:core="sap.ui.core"><Dialog showHeader="true" title="Cart Items" titleAlignment = "Center"><Table id="myDialog" noDataText="No Products Found" \n\t\t\titems="{ path : \'utilModel>/cartItems\', sorter : { path : \'Name\', descending : false } }"><ColumnListItem><cells><ObjectIdentifier title="{utilModel>Name}" text="{utilModel>ProductId}"/><Text text="{utilModel>SupplierName}"/><Text text="{Width} x {Depth} x {Height} {DimUnit}"/><ObjectNumber\n\t\t\t\t\t\tnumber="{ parts:[{path:\'utilModel>Price\'},{path:\'utilModel>CurrencyCode\'}], type: \'sap.ui.model.type.Currency\', formatOptions: {showMeasure: false} }"\n\t\t\t\t\t\tunit="{utilModel>CurrencyCode}"/></cells></ColumnListItem><columns><Column width="12em"><header><Text text="Name"/></header></Column><Column minScreenWidth="Tablet" demandPopin="true"><header><Text text="Supplier"/></header></Column><Column minScreenWidth="Desktop" demandPopin="true" hAlign="Center"><header><Text text="Dimensions"/></header></Column><Column hAlign="Center"><header><Text text="Price"/></header></Column></columns></Table><beginButton><Button text="CheckOut" press="onCheckoutOkClick"/></beginButton><endButton><Button text="Cancel" press="onCheckoutCancelClick"/></endButton></Dialog></core:FragmentDefinition>',
	"socreation_test/SO_Create/view/fragments/userpopover.fragment.xml":'<core:FragmentDefinition\n\txmlns="sap.m"\n\txmlns:core="sap.ui.core"><Popover\n\t\tid="myPopover"\n\t\ttitle="SAP"\n\t\tclass="sapUiResponsivePadding--header sapUiResponsivePadding--footer"\n\t\tplacement="Bottom"\n\t\tinitialFocus="email"><footer><OverflowToolbar><ToolbarSpacer/><Button\n\t\t\t\t\tid="email"\n\t\t\t\t\ttext="Email"\n\t\t\t\t\tpress="handleEmailPress" /></OverflowToolbar></footer><Image src="{ProductPicUrl}" width="15em" densityAware="false" /></Popover></core:FragmentDefinition>'
